export interface ISeries {
    /**
     * **Example**
     * ```typescript
     *
     * values: {
     *  '2014-12-04T17:33:01.538+01:00': [{
     *    min: 13.37,
     *    max: 13.37
     *  },
     *  {
     *    min: 11.37,
     *    max: 11.37
     *  }],
     *  '2014-12-04T17:34:01.774+01:00': [{
     *    min: 10.2,
     *    max: 10.2
     *  },
     *  {
     *    min: 11.37,
     *    max: 11.37
     *  }]
     * }
     * ```
     */
    values: {
        [date: string]: Array<{
            min: number;
            max: number;
        }>;
    };
    /**
     * **Example**
     * ```typescript
     *
     * series: [{
     *   unit: "m/s2",
     *   name: "acceleration",
     *   type: "c8y_AccelerationMeasurement"
     * },
     * {
     *   unit: "m/s",
     *   name: "velocity",
     *   type: "c8y_SpeedMeasurement"
     * }]
     * ```
     */
    series: Array<{
        unit: string;
        name: string;
        type: string;
    }>;
    /**
     * Indicates whether there were more than 5000 values and if the final result was truncated
     */
    truncated: boolean;
}
